import React, { Component } from "react";
import "../styles/selectPlant.scss"

export default class SelectPlant extends Component {
  state = {
    plantInInventory: [
      { id: 0, name: "sapling" },
      { id: 1, name: "root tree" },
    ],
    tools: [{ type: 0, name: "small pot" }],
  };
  render() {
    return (
      <div className="table-select-plant">
        <select id="select-plants">
          {this.state.plantInInventory.map((item, index) => {
            return <option value={item.name}>{item.name}</option>;
          })}
        </select>
        <select id="select-tools">
          {this.state.tools.map((item, index) => {
            return <option value={item.name}>{item.name}</option>;
          })}
        </select>
        Hello 
      </div>
    );
  }
}
